import com.eviware.soapui.model.testsuite.TestRunner.Status

def TC = testRunner.testCase.testSuite.project.testSuites["Using Property transfer and Property Expansion"].testCases["Customer Details"]
TC.testSteps["Customer"].setPropertyValue("Email","Abhay3@gmail.com")
def runner=TC.run(null,false)
log.info "Status:$runner.status ,Time Taken to execute $runner.timeTaken ms"
log.info "Number of Test Steps executed :: " +runner.results.size()


// assert that it didn't fail
assert runner.status != Status.FAILED : runner.reason

/// assert that only four steps ran!!
assert runner.results.size() == 7

